{
    "PWSESSIONRS": [
        {
            "PWPROCESSRS": {
                "PWHEADER": {
                    "APP_ID": "ONEAPP",
                    "ORG_ID": "ONEAPP",
                    "OUT_PROCESS_ID": "oa_getHelp",
                    "IN_PROCESS_ID": "oa_getHelp",
                    "LOGIN_ID": ""
                },
                "PWERROR": "",
                "PWDATA": {
                    "oa_getHelp": {
                        "Row": [
                            {
                                "supportNumber": "8726494540",
                                "helpData": "[{\"answer\": \"To keep your engine running properly, you’ll need to change the oil after several thousand miles—check the owner’s manual to find out how often. To begin, you’ll want to ride the bike for about five minutes just to warm it up. “This lowers the viscosity of the oil so it will drain easier,” explains Olesen. With the engine off and the bike standing upright, remove the drain plug as well as the oil fill plug, letting the oil escape into a drain pan. (You may need to remove some fairing to reach the drain plug.) Also, take out the oil filter.(Warning: This process can get messy! Try covering the engine and/or exhaust section with aluminum foil to protect against drippage.) Once the oil is drained, install a new oil filter, put back any parts you had removed, and refill using a funnel and the proper amount and type of motorcycle oil, as specified in the owner’s manual. Replace the oil fill cap. Recycle the used oil at a bike shop or municipal facility\", \"question\": \"Change The Oil\"}, {\"answer\": \"If your motorcycle’s air filter—which keeps debris out of your engine—is clogged and dirty, your bike’s performance will suffer.“Changing an air filter is not necessarily a hard task, but it can be a time-consuming one,” says Olesen. Sometimes the air filter is easily accessible, but you may have to remove the gas tank and other parts to get to it. Once you get into the air box, take out and replace the air filter. Then reinstall anything you removed.\", \"question\": \"Replace The Air Filter\"}, {\"answer\": \"To check a tire’s pressure, locate the valve stem on the inside of the wheel, remove the cap, and press an air pressure gauge onto the valve stem. Compare the pressure with what it ought to be—that information will be written on the sidewall of the tire. Use an air compressor(available at many gas stations) to fill the tire to the correct number of pounds per square inch (PSI). Let out some air if you over-inflate. Replace the valve stem cap when done. To see how your tread is doing, check the tire’s wear indicator—a little rubber knob that resides in the grooves of the tire. If the knob is at the same level of rubber that meets the road, it’s time for a tire replacement—a job for a professional mechanic.\", \"question\": \"Maintain Tire Pressure And Tread\"}, {\"answer\": \"When it’s time to change the coolant—which prevents your engine from overheating or freezing or getting corroded—remove any necessary bodywork to gain access to the coolant drain bolt, then place a drain pan under the engine and remove the bolt. To make sure everything drains, remove the radiator cap. Once the process is complete, reinstall the drain bolt. Use a funnel to refill the system with the appropriate amount of coolant. Put the radiator cap back on and reinstall any bodywork that you’ve removed. Start the engine and allow it to warm up for a few minutes before cutting the ignition. Once the engine has cooled, remove the radiator cap and check the coolant level. Add more coolant, if needed, to reach the amount specified in the owner’s manual.\", \"question\": \"Change The Coolant\"}, {\"answer\": \"Most chains these days are O-ring chains, says Olesen; they require less cleaning than the old-style unsealed chains. You’ll want to clean the chain when it gets particularly dirty, or at the mileage your owner’s manual recommends. When you do, elevate the rear wheel of your bike and put the transmission in neutral, allowing for easy chain movement. Use a gentle bristle brush to get grit and grime off the chain. To lubricate the chain, rotate the back wheel as you apply specially formulated chain lube. “The goal is to evenly coat the chain, to get the lube to penetrate past the O-rings, into the joint,”says Olesen. Let the chain sit for five minutes, then wipe off the excess lube with a paper towel.\", \"question\": \"Keep A Clean Chain\"}]"
                            }
                        ]
                    }
                }
            }
        }
    ]
}

